// ReviewsList.tsx
import React from 'react';
import Review from './reviews';

const ReviewsList: React.FC = () => {
  const reviewData = [
    { id: 1, text: 'Great experience!', photo: 'ass' },
    { id: 2, text: 'Awesome service!', photo: 'https://example.com/photo2.jpg' },
    // Add more reviews as needed
  ];

  return (
    <div className="reviews-container">
      {reviewData.map((review) => (
        <Review key={review.id} text={review.text} photo={review.photo} />
      ))}
    </div>
  );
};

export default ReviewsList;
